def retry_with_backoff(
    max_retries: int = 3,
    backoff: str = "exponential",
    base_delay: float = 1.0,
    max_delay: float = 60.0,
    retry_on_exceptions: tuple[type[Exception], ...] = (Exception,),
) -> Callable[[Callable[P, T]], Callable[P, T]]:
    """
    Decorator to add retry logic with exponential backoff to a function.

    Args:
        max_retries: Maximum number of retry attempts
        backoff: Backoff strategy - "linear", "exponential", or "fixed"
        base_delay: Base delay in seconds
        max_delay: Maximum delay in seconds
        retry_on_exceptions: Tuple of exception types to retry on

    Returns:
        Decorated function with retry logic

    Example:
        Retry a flaky function with exponential backoff::

            @retry_with_backoff(max_retries=3, backoff="exponential")
            def flaky_api_call():
                return fetch_data()
    """

    # Convert backoff string to enum
    backoff_strategy = BackoffStrategy.EXPONENTIAL
    if backoff == "linear":
        backoff_strategy = BackoffStrategy.LINEAR
    elif backoff == "fixed":
        backoff_strategy = BackoffStrategy.FIXED
    elif backoff != "exponential":
        raise ValueError(
            f"Invalid backoff strategy: {backoff}. Must be 'linear', 'exponential', or 'fixed'"
        )

    retry_config = RetryConfig(
        max_retries=max_retries,
        backoff_strategy=backoff_strategy,
        base_delay=base_delay,
        max_delay=max_delay,
        retry_on_exceptions=retry_on_exceptions,
    )

    def decorator(func: Callable[P, T]) -> Callable[P, T]:
        @functools.wraps(func)
        def wrapper(*args: P.args, **kwargs: P.kwargs) -> T:
            last_error = None

            for attempt in range(retry_config.max_retries + 1):
                try:
                    return func(*args, **kwargs)
                except retry_on_exceptions as e:
                    last_error = e

                    if attempt < retry_config.max_retries:
                        delay = retry_config.calculate_delay(attempt)

                        logger.warning(
                            f"Function {func.__name__} failed on attempt "
                            f"{attempt + 1}/{retry_config.max_retries + 1}: {e}. "
                            f"Retrying in {delay:.2f}s..."
                        )

                        time.sleep(delay)
                    else:
                        logger.error(
                            f"Function {func.__name__} failed after "
                            f"{retry_config.max_retries + 1} attempts: {e}"
                        )

            # All retries exhausted
            raise last_error  # type: ignore

        return wrapper

    return decorator

